import React from 'react'
import { useSelector } from 'react-redux'

const ContactList = () => {
  const state = useSelector((state)=>{
    return state
  })
  console.log('-----------');
  console.log(state);

  return (
    <React.Fragment>
      <h1>contact list</h1>
      {
        state.map((val,idx)=>{
          const {id,fname,lname,phone} = val;
          

        })
      }
    </React.Fragment>
  )
}

export default ContactList
